import { View, Text } from 'react-native'
import React from 'react'
import Todo from './Todo';

const Todos = ({todos}) => {
  return (
    <View style={{ textAlign: 'center', fontSize: 'xx-large', color: 'black', margin: '20px', }}>

      {todos.map(todo => (
        <Todo todo={todo} key={todo.id}/>
      ))}
    </View>
  )
}

export default Todos;
